var $bm_rt;
var a, b, x, w, resize;
a = thisComp.layer('{TEXT_5}').sourceRectAtTime() ? thisComp.layer('{TEXT_5}').sourceRectAtTime().width : 0;
b = thisComp.layer('{TEXT_6}').sourceRectAtTime() ? thisComp.layer('{TEXT_6}').sourceRectAtTime().width : 0;
x = Math.max(a, b);
w = 770;
$bm_rt = resize = $bm_mul($bm_div(w, x), 100);
if (x > w) {
    $bm_rt = [
        resize,
        resize
    ];
} else {
    $bm_rt = [
        100,
        100
    ];
}

